import CoursesList from "../components/CourseList";
import OtherCourses from "../components/OtherCourses";

function CourseDetailsPage() {

  return (
    <>
      <CoursesHero />
      <CoursesList />
      <OtherCourses />
    </>
  );
}

export default CourseDetailsPage;
